  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a compilation of seismic
  event hypocenters data provided by the Alabama Geological Survey as a  Web feature
  service, a web map service, an ESRI service and as an Excel spreadsheet for the
  National Geothermal Data System. The dataset contains 8 worksheets, data for 297
  records is included. Fields in the data table include HypocenterURI, EventName,
  EventURI, Label, CatalogSourceCode, SeisometerNetwork, OriginDateTime, County, State,
  LatDegree, LongDegree, SRS, LocationUncertaintyStatement, Depth, DepthReferencePoint,
  GTEpicenterQuality, GTQualitySupportData, DepthUncertainty, VerticalUnits, DepthDeterminationMethod,
  SamplingFeatureType, Magnitude, MagnitudeType, StandardMagnitudeError, EventType,
  EventTypeTerm, RelatedFault, RelatedFaultURI, Methodology, RelatedResource, Notes
  and Source.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
